	function CariKPK(ar){
		//https://www.ketutrare.com/2019/05/contoh-aplikasi-fpb-dan-kpk-menggunakan-bahasa-c.html
		
		var min = ar[0];
		var max = ar[0];
		for(i=0;i<ar.length;i++){
			min = Math.min(min,ar[i]);
			max = Math.max(max,ar[i]);
		}
		
		var iter = max;
		var kpk = 1;
		var f = [];
		do {
			iter++;
			ff = 1;
			for(i=0;i<ar.length;i++){
				f[i] = Mods(iter,ar[i])!=0;
				ff += f[i];
			}
			kpk = iter;
			fakhir = ff==1;
		}while (!fakhir)
		
		return kpk;
	}
